-- ----------------------------
-- Table structure for cmf_statistics_cameras
-- ----------------------------
DROP TABLE IF EXISTS `cmf_statistics_cameras`;
CREATE TABLE `cmf_statistics_cameras` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `altitude` int(11) DEFAULT NULL COMMENT '海拔高度',
  `cameraIndexCode` varchar(255) DEFAULT NULL COMMENT '监控点编号',
  `cameraName` varchar(255) DEFAULT NULL COMMENT '监控点名称',
  `cameraType` tinyint(1) unsigned DEFAULT NULL COMMENT '监控点类型（0-枪机,1-半球,2-快球,3-带云台枪机',
  `cameraTypeName` varchar(255) DEFAULT NULL COMMENT '监控点类型说明',
  `capabilitySet` varchar(255) DEFAULT NULL COMMENT '能力集',
  `capabilitySetName` varchar(255) DEFAULT NULL COMMENT '能力集说明',
  `intelligentSet` varchar(255) DEFAULT NULL COMMENT '智能分析能力集',
  `intelligentSetName` varchar(255) DEFAULT NULL COMMENT '智能分析能力集说明',
  `channelNo` int(11) DEFAULT NULL,
  `channelType` varchar(255) DEFAULT NULL COMMENT '通道子类型',
  `channelTypeName` varchar(255) DEFAULT NULL COMMENT '通道子类型说明',
  `createTime` datetime DEFAULT NULL COMMENT '监控点创建时间',
  `encodeDevIndexCode` varchar(255) DEFAULT NULL COMMENT '所属设备编号',
  `encodeDevResourceType` varchar(255) DEFAULT NULL COMMENT '所属设备类型',
  `encodeDevResourceTypeName` varchar(255) DEFAULT NULL COMMENT '所属设备类型说明',
  `gbIndexCode` varchar(255) DEFAULT NULL COMMENT '监控点国标编号',
  `installLocation` varchar(255) DEFAULT NULL,
  `keyBoardCode` varchar(255) DEFAULT NULL,
  `latitude` varchar(255) DEFAULT NULL COMMENT '纬度',
  `longitude` varchar(255) DEFAULT NULL COMMENT '经度',
  `pixel` tinyint(1) unsigned DEFAULT NULL COMMENT '摄像机像素（1-普通像素，2-130万高清，3-200万高清，4-300万高清',
  `ptz` tinyint(1) unsigned DEFAULT NULL COMMENT '云镜类型（1-全方位云台（带转动和变焦），2-只有变焦,不带转动，3-只有转动，不带变焦，4-无云台，无变焦',
  `ptzName` varchar(255) DEFAULT NULL COMMENT '云镜类型说明',
  `ptzController` tinyint(1) unsigned DEFAULT NULL COMMENT '云台控制（1-DVR,2-模拟矩阵,3-MU4000,4-NC600',
  `ptzControllerName` varchar(255) DEFAULT NULL COMMENT '云台控制说明',
  `recordLocation` varchar(255) DEFAULT NULL COMMENT '录像存储位置（0-中心存储，1-设备存储',
  `recordLocationName` varchar(255) DEFAULT NULL COMMENT '录像存储位置说明',
  `regionIndexCode` varchar(255) DEFAULT NULL,
  `status` varchar(255) DEFAULT NULL COMMENT '在线状态（0-不在线，1-在线',
  `statusName` varchar(255) DEFAULT NULL COMMENT '状态说明',
  `transType` tinyint(1) unsigned DEFAULT NULL COMMENT '传输协议（0-UDP，1-TCP',
  `transTypeName` varchar(255) DEFAULT NULL COMMENT '传输协议类型说明',
  `treatyType` varchar(255) DEFAULT NULL COMMENT '接入协议',
  `treatyTypeName` varchar(255) DEFAULT NULL COMMENT '接入协议类型说明',
  `viewshed` varchar(255) DEFAULT NULL COMMENT '可视域相关（JSON格式）',
  `updateTime` varchar(255) DEFAULT NULL COMMENT '监控点更新时间',
  `longitudeLatitude` varchar(255) DEFAULT NULL,
  `dir_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=154 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of cmf_statistics_cameras
-- ----------------------------

